INSERT INTO `projects` VALUES (8,'NoSQL Database Recommendation Tool','NoSQL (commonly interpreted as \"not only SQL\"[1]) is a broad class of database management systems identified by non-adherence to the widely used relational database management system model. NoSQL database systems are often highly optimized for retrieval and appending operations and often offer little functionality beyond record storage (e.g. keyvalue stores). The reduced run-time flexibility compared to full SQL systems is compensated by marked gains in scalability and performance for certain data models.\r\n\r\nThere are large numbers of NoSQL databases based on very different technologies and supports very different class of problems. The objective of this research is to develop a tool that can suggest the most suitable solution based on given input parameters.\r\n\r\nNoSQL promises to give highly scalable and high performance data store for modern applications. However a wrong choice of database type may result in great failures. Currently, it is difficult to find any research papers of guidelines that can be used to choose the correct NoSQL database to solve a given class of problems.  \r\n\r\nDevelop a tool that can take application parameters like application type, the size of the data store, the types of queries that has to be frequently executed, etc. and suggest the best NoSQL databse (or suggest to go with a Relational Database if that is the best match)\r\n','Kosala Gunaratne','0713433552',23,'2014-06-22 09:57:30','Active'),(9,'Sign Language Recognition','Speech recognition has come a long way and today we have software that successfully does Speech recognition. The software SIRI included in the Applie iPhone is one that got a lot of attention due to its success.\r\n\r\nHowever, the state-of-the-art speech recognition software is not to be enjoyed by the people who cant speak. For them the only way of communication is signing (sign language). It would be pretty nice if the computers and mobile devices could understand sign language.\r\n\r\nDevelop software that could interpret/recognize sign language\r\nShould be able to run on a mobile device with a camera\r\nHand gesture capturing from a video\r\n - An API which can be utilized by the application developers (just like what Microsoft Kinect does)\r\n - A reference implementation of the API\r\n','Rusiru Senaratne','0773433535',15,'2014-06-22 10:05:22','Active'),(10,'Developing a real time large scale request monitoring system','When you are handling an eCommerce website, you often get lots of either bad or good bot requests trying to crawl your website. These are sometimes challenging to website due to various reasons.\r\n\r\n1. a very high number of requests per second can exhaust the capacity of the web site either increasing the user response time or much worse bringing down the whole site\r\n2. if a site it counting number of users coming into the web site, it should be able to exclude these requests\r\n\r\nThe basic idea of this project is to identify the patterns of requests coming from a certain IP, user agent, etc and taking necessary steps in the real time. \r\n\r\nChallenges\r\n\r\n1. you will be hosting large number of front end web servers (a server farm) to handle user requests coming into your website. If you want to identify patterns you might have to gather data from ALL the nodes to take decisions as these crawlers might be hitting different servers. \r\n2. The actions that can be implemented can include, providing a captcha, throttling the requests, slowing down the response time, or may be completely denying the service by black listing those requests.\r\n3. since these bots attack fast and create disasters within few mins, these data collections and pattern recognitions should happen pretty fast and actions should be deployed within a reasonable amount of time.\r\n4. coming up with or searching for a set of heuristics / algorithms to identify bot patterns\r\n5. finding the best set of parameters/features to be monitored\r\n6. scaling the system when you are handling thousands of nodes\r\n7. expiring the deployed policies over time\r\n8. ability to manually introduce policies\r\n9. providing an admin interface to view and manage these policies\r\n','Nimantha Silva','0713435435',5,'2014-06-23 13:16:46','Active'),(11,'3D movie on mobile phone','Video Codec, Video synchronizing, CPU and Memory optimization Human Vision, Optics. 3D movies can be played in dedicated screens and it requires proprietary eye-ware to be worn. The cost and non availability of these devices hinders the adaptation of 3D movie by masses. One solution would be to combine two cheap mobile devices and some optics to provide 3D experience.\r\nCurrent 3D movies are only visible by specially designed LCD screens. \r\n\r\nOne solution would be to provide personal/private 3D movie experience. In order to do this following can be adopted.\r\nMake two small LCD screens display the stereo video. Use optics to provide 3D visualization on the two LCD screens. Please see ref: 1. However this is not possible due to budgetary constraints for ordinary people.\r\nSolution is to use two mobile phones, use its LCD screen and couple of lenses and mirrors to mimic the above heads up display unit. The mobile phones used should not be dismantled at all. Both of them should communicate and display the relevant portion of the stereo screen. This will enable 3D movie experienced by an enthusiastic person to make such a device and experience the 3D world.\r\nThis allows full field of view if proper lenses and mirrors are selected and properly placed. (therefore student should have good knowledge about physics specially on optics. Pre- University optics lessons would help)\r\n','Shanaka Vijesooriya','0715564647',7,'2014-06-22 10:08:07','Active'),(12,'Augmented Reality','Think about an art gallery, for each exhibit contains information stored in NFC or low power bluetooth module. Read the information and display on the mobile screen and play a voice clip describing the exhibit. End users are exhibition hosts, and visitors.\r\n\r\nDemonstrated a simple art-gallery with either NFC or Bluetooth chips. Should demonstrate audio, video and web links of the exhibits using mobile device.','Hasith Yaggahavita','0714819556',5,'2014-06-22 10:11:34','Active');
